import React from 'react'
import { makeStyles } from '@material-ui/core/styles'
import Button from '@material-ui/core/Button'
import Particles from 'react-particles-js'
import Grid from '@material-ui/core/Grid'
import Avatar from '@material-ui/core/Avatar'
import Paper from "@material-ui/core/Paper"

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    '& > *': {
      margin: theme.spacing(1),
      width: theme.spacing(16),
      height: theme.spacing(16),
    },
  },
}))

const particleOpt = {
  particles: {
    number: {
      value: 100,
      density: {
        enable: false,
        value_area: 800
      },
      move: {
        enable: true,
        speed: 1
      }
    }
  },
  interactivity: {
    events: {
        onhover: {
            enable: true,
            mode: ["push"]
        }
    }
  }
}

function Index(props) {
    const classes = useStyles()
    return (
      <div className={classes.root}>
        <Particles canvasClassName="particle-canvas" params={particleOpt} />
        <Grid className="wrapper">
          <Paper className="introduction">
            <Grid container item direction="column" xs>
              <Grid item container xs={3}>
                <Avatar alt="Profile Picture" size="large" src="/img/maicon.png" />
              </Grid>
              <Grid item xs={9} direction="row" container className="hello" component="hgroup">
                <h1 align="center">Hello, I'm <span>Maicon Esteves</span></h1>
                <h2 align="center">I'm a full-stack developer</h2>
                <Button className="bt-index" variant="outlined" size="large" color="secondary" href="home">Default</Button>
              </Grid>
            </Grid>
          </Paper>
        </Grid>
      </div>
    )
}

export default Index
